import React from "react";
import { useLocation } from "react-router-dom";
import "./Header.css";
import Navbar from "../Navbar/Navbar";
import SplitText from "../SplitText/SplitText";
import { easings } from '@react-spring/web';

import RotatingText from "../RotatingText/RotatingText";
import AnimatedContent from "../AnimatedContent/AnimatedContent";

type HeaderProps = {
  backgroundImage: string;
  title: string;
  subtitle: string;
  buttonText: string;
  onButtonClick: () => void;
};

export default function HeaderComponent({
  backgroundImage,
  title,
  subtitle,
  buttonText,
  onButtonClick,
}: HeaderProps) {

  const location = useLocation()

  const handleAnimationComplete = () => {
    console.log("animated")
  }

  return (
    <header
      className="header-component"
      style={{ backgroundImage: `url(${backgroundImage})` }}
    >


      <Navbar></Navbar>

      {location.pathname === "/" &&

        (
          <div className="header-title header-content">

            <SplitText
              text={title}
              className="text-2xl font-semibold text-center"
              delay={50}
              animationFrom={{ opacity: 0, transform: 'translate3d(0,50px,0)' }}
              animationTo={{ opacity: 1, transform: 'translate3d(0,0,0)' }}
              easing={easings.easeOutCubic}
              threshold={0.2}
              rootMargin="-50px"
              onLetterAnimationComplete={handleAnimationComplete}
            />

            <div className="header-subtitle">

              <AnimatedContent
                distance={150}
                direction="vertical"
                reverse={false}
                config={{ tension: 80, friction: 20 }}
                initialOpacity={0.2}
                animateOpacity
                scale={1.1}
                threshold={0.2}
              >


                <div className="row">
                  <p className="col-6 ml">CONTINUA A </p>
                  <RotatingText
                    texts={['COMBATTERE', 'CREDERCI', 'MIGLIORARE', 'CONQUISTARE']}
                    mainClassName="px-2 sm:px-2 md:px-3 bg-cyan-300 text-black overflow-hidden py-0.5 sm:py-1 md:py-2 justify-center rounded-lg rota col-6"
                    staggerFrom={"last"}
                    initial={{ y: "100%" }}
                    animate={{ y: 0 }}
                    exit={{ y: "-120%" }}
                    staggerDuration={0.025}
                    splitLevelClassName="overflow-hidden pb-0.5 sm:pb-1 md:pb-1"
                    transition={{ type: "spring", damping: 30, stiffness: 400 }}
                    rotationInterval={2000}
                  />
                </div>
              </AnimatedContent>

            </div>

          </div>
        )}


      {
        location.pathname === "/note-legali" &&
        (
          <>
            <h2>Note Legali</h2>

            <h3>Termini Legali</h3>
            <p>Il presente avviso contiene i termini e le condizioni legali che regolano il sito di proprietà di Marco Nitto.
              Accedendo al sito, gli utenti si impegnano ad accettare e concordare di attenersi al rispetto di tutte le condizioni
              contenute in questa dichiarazione.
              La nostra ditta si riserva il diritto di chiedere agli Utenti che non accettino o non intendano rispettare tali termini, di astenersi dall’utilizzo del sito web.
              L’accesso al sito ed ai relativi servizi è destinato esclusivamente ad utilizzo personale.
              La visualizzazione del sito fornisce ai Clienti informazioni sui prodotti proposti insieme alla possibilità di acquisto degli stessi.</p>

            <h3>Proprietà – Copyright</h3>

            <p>
              Il sito ed il suo contenuto è proprietà di Marco Nitto. 
              Ciò include documentazione, immagini, caratteri, design, musica, software, codici e format scripts.
              Il materiale contenuto nel sito web è protetto da copyright. Qualsiasi riproduzione, alterazione, trasmissione,
               pubblicazione o ridistribuzione a terzi, per scopi commerciali, è severamente vietata se priva di espresso consenso
                scritto fornito da Marco Nitto. Pertanto si vieta l’utilizzo del contenuto o dei marchi presenti nel sito per ogni 
                altro scopo e fine diversi da quelli sopra citati.
            </p>

            <h3>Articoli ed Immagini On-Line</h3>

            <p>Marco Nitto declina ogni responsabilità circa la possibilità che, a causa di una particolare configurazione del computer
               utilizzato dal Cliente o di un suo malfunzionamento, i colori dei prodotti visualizzati sul sito presentino leggere 
               differenze rispetto a quelli originali.
               Le immagini contenute sul sito sono di proprietà di Warfit. Ogni utilizzo di tali immagini, non autorizzato da un consenso
                scritto, sarà perseguito a norma di legge.

               {/* Disponibilità degli articoli

               Nell’eventualità in cui gli articoli ordinati non siano disponibili, o se per qualche motivo l’ordine non possa essere 
               evaso come da richiesta del Cliente, lo stesso ufficio darà tempestiva comunicazione al Cliente. */}

               </p>

               <h2>TIPOLOGIE DI DATI RACCOLTI</h2>

               <p>Fra i Dati Personali raccolti da questa Applicazione, in modo autonomo o tramite terze parti, ci sono: Cookie, 
                Dati di utilizzo, Nome, Email, Cognome, Numero di Telefono, Indirizzo, Nazione, CAP e Città.

                Altri Dati Personali raccolti potrebbero essere indicati in altre sezioni di questa privacy policy o mediante testi informativi visualizzati contestualmente alla raccolta dei Dati stessi.
                I Dati Personali possono essere inseriti volontariamente dall’Utente, oppure raccolti in modo automatico durante l’uso di questa Applicazione.
                L’eventuale utilizzo di Cookie – o di altri strumenti di tracciamento – da parte di questa Applicazione o dei titolari dei servizi terzi utilizzati da questa Applicazione, ove non diversamente precisato, ha la finalità di identificare l’Utente e registrare le relative preferenze per finalità strettamente legate all’erogazione del servizio richiesto dall’Utente.
                Il mancato conferimento da parte dell’Utente di alcuni Dati Personali potrebbe impedire a questa Applicazione di erogare i propri servizi.

                L’Utente si assume la responsabilità dei Dati Personali di terzi pubblicati o condivisi mediante questa Applicazione e garantisce di avere il diritto di comunicarli o diffonderli, liberando il Titolare da qualsiasi responsabilità verso terzi.</p>


          </>
        )
      }


    </header>
  );
}
